import React from 'react'
import { COLOR_BORDER_GAME, COLOR_COLOR_TEXT1 } from '../../constrant'

export default function CardTou() {

    return (
        <div style={{
            width: "275px", height: "216px", position: 'relative',
            borderStyle: 'solid', borderWidth: "1px", borderColor: COLOR_COLOR_TEXT1
        }}>
            <img style={{
                height: "154px", borderBottomColor: COLOR_COLOR_TEXT1, borderBottomWidth: "1px",
                borderBottomStyle: 'solid'
            }}
                src="data:image/jpeg;base64,">
            </img>
            <div style={{
                position: 'absolute', top: 10, background: 'red',
                marginLeft: "5px", borderRadius: "6px", padding: '5px', color: 'white'
                , fontSize: '10px'
            }}>
                <a>1/1/2020 - 20/3/2021</a>
            </div>
            <div style={{position:'absolute',bottom:60,color:'white',
        fontSize:'12px',marginLeft:"5px"}}>
                <a>100N người xem</a>
            </div>

            <div style={{display:'flex',flexDirection:'row'}}>
                <a>OMG vs DMG</a>
            </div>
        </div>
    )
}
